SET DATEFORMAT dmy;

DECLARE @DataTable TABLE (
    Deal INT,
    AdvanceDate DATE,
    PROV VARCHAR(50),
    DealPurpose VARCHAR(255),
    RateType VARCHAR(50),
    BEACON INT,
    LTV FLOAT,
    TDS FLOAT,
    GDS FLOAT,
    InsuranceType VARCHAR(50),
    PrincipalBalance FLOAT,
    OccupancyType VARCHAR(50),
    AccountStatus VARCHAR(50),
    Closed_Date DATE,
    DelinquencyBucket VARCHAR(50)
);


SELECT CAST(SUM(PrincipalBalance) AS DECIMAL(20)) [$AUM] FROM @DataTable;

SELECT COUNT(Deal) [AUM Count] FROM @DataTable;

SELECT CAST((SUM(PrincipalBalance) / COUNT(Deal)) AS DECIMAL(20,2)) [Avg Mortgage Size] FROM @DataTable WHERE ISNULL(PrincipalBalance, 0) <> 0;

WITH CTE_Beacons AS 
	(
		SELECT
			BEACON,
			COUNT(*) OVER() AS TotalCount,
			ROW_NUMBER() OVER (ORDER BY BEACON) AS RowAsc,
			ROW_NUMBER() OVER (ORDER BY BEACON DESC) AS RowDesc
		FROM @DataTable
	), CTE_Median AS (
		SELECT BEACON
		FROM CTE_Beacons
		WHERE RowAsc = TotalCount / 2 + 1
		   OR RowDesc = TotalCount / 2 + 1
	)

SELECT AVG(CAST(BEACON AS FLOAT)) AS [Median Credit Score] FROM CTE_Median;

SELECT CAST((SUM(LTV * PrincipalBalance) / NULLIF(SUM(PrincipalBalance), 0)) AS DECIMAL(20,2)) AS [Weighted Avg LTV] FROM @DataTable;

SELECT CAST(AVG(CAST(GDS AS FLOAT)) AS DECIMAL(20,2)) AS [Average GDS] FROM @DataTable WHERE GDS > 0;

SELECT CAST(AVG(CAST(TDS AS FLOAT)) AS DECIMAL(20,2)) AS [Average TDS] FROM @DataTable WHERE TDS > 0;

SELECT CAST(AVG(DATEDIFF(MONTH, AdvanceDate, GETDATE())) AS DECIMAL(20,2)) AS AverageAgeInMonths FROM @DataTable;

SELECT CAST((SUM(PrincipalBalance) / ( SELECT SUM(PrincipalBalance) FROM @DataTable ) * 100 ) AS DECIMAL(20,2)) AS [% Fixed Rate] 
FROM @DataTable 
WHERE RateType = 'Fixed';

SELECT CAST((SUM(PrincipalBalance) / ( SELECT SUM(PrincipalBalance) FROM @DataTable ) * 100 ) AS DECIMAL(20,2)) AS [% Conventional] 
FROM @DataTable 
WHERE LTV <= 80;

SELECT CAST((SUM(PrincipalBalance) / ( SELECT SUM(PrincipalBalance) FROM @DataTable ) * 100 ) AS DECIMAL(20,2)) AS [% Purchase Type] 
FROM @DataTable 
WHERE DealPurpose IN ( 'Purchase', 'Purchase with Improvements' );

SELECT CAST((SUM(PrincipalBalance) / ( SELECT SUM(PrincipalBalance) FROM @DataTable ) * 100 ) AS DECIMAL(20,2)) AS [% Owner Occupied] 
FROM @DataTable 
WHERE OccupancyType = 'Owner-Occupied';

SELECT CAST((SUM(PrincipalBalance) / ( SELECT SUM(PrincipalBalance) FROM @DataTable ) * 100 ) AS DECIMAL(20,2)) AS [% Ontario Mix] 
FROM @DataTable 
WHERE PROV = 'ON';

SELECT CAST((SUM(PrincipalBalance) / ( SELECT SUM(PrincipalBalance) FROM @DataTable ) * 100 ) AS DECIMAL(20,2)) AS [% British Columbia Mix] 
FROM @DataTable 
WHERE PROV = 'BC';

SELECT CAST((SUM(PrincipalBalance) / ( SELECT SUM(PrincipalBalance) FROM @DataTable ) * 100 ) AS DECIMAL(20,2)) AS [% Alberta Mix] 
FROM @DataTable 
WHERE PROV = 'AB';

SELECT ( CAST(COUNT(Deal) AS DECIMAL(20,2)) / ( SELECT CAST(COUNT(Deal) AS DECIMAL(20,2)) FROM @DataTable ) ) * 100.00 AS [30+ Days In Units]
FROM @DataTable 
WHERE DelinquencyBucket IN ( '30-59', '60-89', '90+' );

SELECT ( CAST(COUNT(Deal) AS DECIMAL(20,2)) / ( SELECT CAST(COUNT(Deal) AS DECIMAL(20,2)) FROM @DataTable ) ) * 100.00 AS [EPD]
FROM @DataTable 
WHERE DelinquencyBucket = '90+'
	AND DATEDIFF(MONTH, AdvanceDate, GETDATE()) = 12;